//   flex-direction: row;
//   flex-wrap: wrap;
//   align-content: flex-start;
//   overflow: hidden;
//   border: 10px solid green;
//   background: blue;
// `;

const Container = styled.div`
  height: 550px;
  width: 300px;
  overflow: visible;
  border: 10px solid green;
`;

const Map = styled.div`
  width: 200px;
  height: 200px;
  background-color: blue;
`;

const WrapperBack = () => {
  return (
    <Container>
      <TransformWrapper
        defaultScale={0.1}
        defaultPositionX={100}
        defaultPositionY={100}
        minScale={0.1}
        maxScale={10}
      >
        {({
          zoomIn,
          zoomOut,
          resetTransform,
          positionX,
          positionY,
          ...rest
        }) => (
          <React.Fragment>
            <TransformComponent>
              <Map></Map>
            </TransformComponent>
          </React.Fragment>
        )}
      </TransformWrapper>
    </Container>
  );
};

export default WrapperBack;

